import React from 'react';
import Card from './Card/Card'

const DEFAULT_STATE = {
    users: []
};

class UserMiniCard extends React.Component {

    state = {...DEFAULT_STATE};

    constructor(props) {
        super(props);
        this.state.users = this.props.users;
    }
    render() {
        const { users } = this.state;
        if (users.length)
            users.map((user, i) => {
                console.log(user);
                return (
                    <Card
                        user={user}
                        key={i}
                    />
                )
            });
        return null;
    }
}
export default UserMiniCard;
